import React from 'react';
import './Cards.css'
import gelatoHome from '../Images/gelatoHome.png';

const Cards = () => {
  return (    
    <div class="card bg-dark cardSize text-white "> 
      <img class="card-img" src={gelatoHome} alt="Card image"/>
      <div class=" centerOverlay">
        <h5 class="card-title ">Ice cream</h5>
        <button className="btn btn-outline-light">Explore options</button>
      </div>
    </div>
  );
};

export default Cards;
